window.nsdJsTreeSearchCallback = function(str, node) { 
    var sf = new $.vakata.search(str, true, { caseSensitive : false, fuzzy : false }); 
    if (sf.search(node.text).isMatch) {
		return true;
	} 
    let searchResult = this.search(str); 
    for (const sr in searchResult) {
        if (searchResult[sr].ref === node.original['data-nsd-action-uuid']) {
            return true;
        } 
    } 
    return false; 
}.bind(lunr(function () {
			  this.ref('id');
			  this.field('title');
			  this.field('content');

			  for (const key in searchDocuments) {
				  let doc = searchDocuments[key];
				this.add({
					id: doc['action-uuid'],
					title: doc.title,
					path: doc.path,
					content: doc.content
				});  
			  }
			}));
</script>

entation (diagram). " alt="" coords="32,259,176,342"> <area shape="rect" id="id33" href="Artifact.html" title="Input to a flow element, e.g. activity, or an output from a flow element. " alt="" coords="667,731,796,842"> <area shape="rect" id="id34" href="ArtifactParticipantResponsibility.html" title="Responsibility assignments for an artifact at the activity level if different from the activity responsibility assignments." alt="" coords="288,1460,492,1543"> <area shape="rect" id="id35" href="FlowElement.html" title="FlowElement is an abstract base class for Flow elements. " alt="" coords="607,1253,756,1382"> <area shape="rect" id="id36" href="PackageElement.html" title="Base class for elements which can be contained in a package and as such inherited, overridden, and suppressed." alt="" coords="723,38,864,181"> <area shape="rect" id="id37" href="ParticipantResponsibility.html" title="Base class for elements for which participants can responsible for, accountable, consulted, or informed. " alt="" coords="380,1064,562,1179"> </map>
